import "../Styles/header.css";

const Header = () => {
  return (
    <div className='header'>
          <h2>Onni.</h2>
          <ul>
              <li><a href="#about">About</a></li>
              <li><a href="#about">Skills</a></li>
              <li><a href="#about">Projects</a></li>
              <li><a href="#about">Contact</a></li>
          </ul>
    </div>
  );
};

export default Header;
